import { NgModule, CUSTOM_ELEMENTS_SCHEMA } from '@angular/core';
import { RouterModule } from '@angular/router';

@NgModule({
  imports: [
    RouterModule.forChild([
      {
        path: 'dipendente',
        loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('.\\dipendente\\dipendente.module')['TestDipendenteModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
      },
      {
        path: 'skill',
        loadChildren: function() { return new Promise(function (resolve, reject) {  (require as any).ensure([], function (require: any) {    resolve(require('.\\skill\\skill.module')['TestSkillModule']);  }, function(e: any) {    reject({ loadChunkError: true, details: e });  });}) }
      }
      /* jhipster-needle-add-entity-route - JHipster will add entity modules routes here */
    ])
  ],
  declarations: [],
  entryComponents: [],
  providers: [],
  schemas: [CUSTOM_ELEMENTS_SCHEMA]
})
export class TestEntityModule {}
